import React from "react";
import 'bootstrap/dist/css/bootstrap.css';

const Navbar = () => {
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <a className="navbar-brand" href="/">
                    <img src="https://static.wixstatic.com/media/5602be_11b8ffca7ff94b28872e166194045e3e~mv2.png/v1/fill/w_332,h_100,al_c,q_85,usm_0.66_1.00_0.01/ecovia%20logo%20copy.webp" alt="ecovia-logo" width="130" height="45" />
                </a>
            </nav>
        </div>
    );
}

export default Navbar;
